const Cardboard = () => {

    const cards = [
        {
            image: '一', name: 'いち',
            image: '二', name: 'に',
            image: '三', name: 'さん',
            image: '四', name: 'よん',
            image: '五', name: 'ご',
            image: '六', name: 'ろく',
            image: '七', name: 'なな',
            image: '八', name: 'はち',
            image: '九', name: 'く',
            image: '十', name: 'じゅう',
            image: '百', name: 'ひゃく',
            image: '億', name: 'おく',
        }
    ]

    return(
        <div classname="cardboard">
            CARDBOARD
        </div>
    )
}

export default Cardboard;
